import React from "react";
import {Box, Checkbox} from "@mui/material";
import {Stack} from '@mui/system';
const Feed = () => {
    return ( 
        <Box bgcolor="white " flex={4} p={2} >
            <Stack 
                gap={40}
                direction={'row'}
                spacing={{ xs: 1, sm: 2, md: 4 }}
            sx={{
                display: { xs: 'none', sm: 'block' }
            }}>
                <Box  sx={{
                    height:"300px",width:"100%" ,backgroundColor:"blue"
                }}> </Box>
                <Box  sx={{
                    height:"400px",width:"100%" ,backgroundColor:"blue"
                }}> </Box>
                <Box  sx={{
                    height:"400px",width:"100%" ,backgroundColor:"blue"
                }}> </Box>
                <Box  sx={{
                    height:"400px",width:"100%" ,backgroundColor:"blue"
                }}> </Box>
            </Stack>
        </Box>
    );
}
export default Feed;
